import { Routes, BrowserRouter, Route} from 'react-router-dom';
import './App.css';
import Home from './pages/home'
import About from './pages/about'

function App() {
  return (
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />}/>
            <Route index element={<About />} />
        </Routes>
      </BrowserRouter>
  );
}

export default App;
